import React from "react";
import FeatureForm from "./components/FeatureForm";

function App() {
  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>PCOS Predictor</h1>
      <FeatureForm />
    </div>
  );
}

export default App;
